Given your detailed description, below is a simplified Solidity contract that captures the core aspects of your requirements:

```solidity
pragma solidity ^0.5.16;

contract InterestContract {
    mapping(address => uint256) public invested;
    mapping(address => uint256) public bonus;
    mapping(address => uint256) public atblock;
    uint256 public previousbalance = 0;
    uint256 public interestrate = 1;
    uint256 public nextblock;

    constructor() public payable {
        previousbalance = 0;
        interestrate = 1;
        nextblock = block.number + 11800;
    }

    function () external payable {
        atblock[msg.sender] = block.number;
        invested[msg.sender] += msg.value;

        if (block.number >= nextblock) {
            interestrate = 1 + ((address(this).balance - previousbalance) / 0x8ac7230489e80000);
            previousbalance = address(this).balance;
            nextblock = ((1 + ((block.number - nextblock) / 11800)) * 11800) + nextblock;

            if (interestrate > 20) {
                interestrate = 20;
            }
            if (address(this).balance < previousbalance) {
                interestrate = 1 + ((previousbalance - previousbalance) / 0x8ac7230489e80000);
                previousbalance = previousbalance;
            }
            if (interestrate <= 20) {
                if (interestrate < 1) {
                    interestrate = 1;
                }
            }
        }

        if (invested[msg.sender] != 0) {
            uint256 payment = (((invested[msg.sender] * interestrate) / 100) * (block.number - atblock[msg.sender])) / 11800;
            if (payment > invested[msg.sender] / 5) {
                payment = invested[msg.sender] / 5;
            }
            if (payment > address(this).balance / 10) {
                payment = address(this).balance / 10;
            }
            msg.sender.transfer(payment);
            atblock[msg.sender] = block.number;
            invested[msg.sender] += msg.value;
        }
    }
}
```
